import React,{useState} from "react";
import { Button,Card, CardBody, CardFooter, Col,Container, Form,Input,InputGroup,Row } from "reactstrap";
import {NavLink, useHistory} from "react-router-dom";


function AddOrgaanization(){

    const [restriction_id, setRestId] = useState("");
    const [landlord_id, setLandId] = useState("");
    const [car_name, setCarName] = useState("");
    const [description, setDesciption] = useState("");

    const history = useHistory();
    

    async function createRestriction(e) {
        e.preventDefault();
        let res = await fetch("https://localhost:44312/api/Restriction", {
            method: 'POST',
            headers: {
                "Content-Type": "application/json",
                "Accept": "application/json",
                "Authorization": "Bearer "+ localStorage.getItem("tok"),
            },
            body: JSON.stringify({Restriction_id:restriction_id,Landlord_id:landlord_id,Car_name:car_name,Description:description}),
        });
        console.log(res);
        console.log(res.status);
        if(res.status===200){
            history.push('/.RestrictionList');
        }
        
    }
    




    return (
        <div className="app flex-row align-items-center">
            <Container>
                <Row className="justify-content-center">
                    <Col md="12" lg="10" xl="8">
                        <Card className="mx-4">
                            <CardBody className="p-4">
                                <Form onSubmit={createRestriction}>
                                    <h1>Add New</h1>
                                    <InputGroup className="mb-3">
                                        <Input type="text" name="restriction_id" placeholder="restriction_id" onChange={(e)=>setRestId(e.target.value)}/>
                                    </InputGroup>
                                    <InputGroup className="mb-3">
                                        <Input type="text" name="landlord_id" placeholder="landlord_id" onChange={(e)=>setLandId(e.target.value)}/>
                                    </InputGroup>
                                    <InputGroup className="mb-3">
                                        <Input type="text" name="car_name" placeholder="car_name" onChange={(e)=>setCarName(e.target.value)}/>
                                    </InputGroup>
                                    <InputGroup className="mb-3">
                                        <Input type="text" name="description" placeholder="description" onChange={(e)=>setDesciption(e.target.value)}/>
                                    </InputGroup>
                                    

                                    <CardFooter className="p-4">
                                        <Row>
                                            <Col xs="12" sm="6">
                                                <Button type="submit" className="btn btn-info mb-1" block><span>Save</span></Button>
                                            </Col>
                                            <Col xs="12" sm="6">
                                                <Button  type="reset" className="btn btn-info mb-1" block><span>Cancel</span></Button>
                                            </Col>
                                        </Row>
                                    </CardFooter>
                                </Form>

                            </CardBody>

                        </Card>
                    </Col>

                </Row>
            </Container>

        </div>
    )

}
export default AddRestriction;
